import React, { Component } from 'react';

class DataView extends Component {
    constructor(props) {
        super(props);
        this.state = {visible: false}
    }
    render() { 
         return(
            <div>
                {
                    this.state.visible 
                    ?<div>
                        <p>dataview showing</p>
                    </div>
                    :<div>
                        <p>dataview hidden</p>
                    </div>
                }
            </div>
         )
    }
}
 
export default DataView;
